import axios from "axios";
import dayjs from 'dayjs';
import { useEffect, useState } from "react";
import { DemoContainer } from '@mui/x-date-pickers/internals/demo';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { TimePicker } from '@mui/x-date-pickers/TimePicker';

export default function Schedule() {
    const [select, setSelected]  = useState('');
    const [optionList,setOptionList] = useState([]);
    const fetchData = () => {
        axios
          .get('http://localhost:8080/api/movie/getAll')
          .then((response) => {
            const { data } = response;
            if(response.status === 200){
                //check the api call is success by stats code 200,201 ...etc
                setOptionList(data)
            }else{
                //error handle section 
            }
          })
          .catch((error) => console.log(error));
      };

    useEffect(()=>{
        fetchData();
    },[])

    async function handleSubmit(e) {
        /* do not schedule the movie if the start time and the movie title matches with an existing schedule */
        window.location.assign("http://localhost:3000/schedule");
        alert("Movie Scheduled");

    }

    return (
    <body style={{backgroundColor: 'crimson'}}>
    <h1 style={{backgroundColor: 'crimson', fontSize: '30px', color: 'black', paddingTop: '30px'}}>Schedule Movies</h1>
    
    <form onSubmit={handleSubmit}>
        <h2 style={{color: 'black'}}>Showing Date</h2>
        <div classname="registerformat" style={{ padding: "10px", color: 'black'}}>
            
            <LocalizationProvider dateAdapter={AdapterDayjs}>
            <DemoContainer components={['DatePicker']}>
            <DatePicker 
                label="Movie Date" 
                variant="solid"
                onChange={''}
            />
            </DemoContainer>
            </LocalizationProvider>
        </div>

        <div classname="registerformat" style={{ padding: "10px", color: 'black'}}>
            <LocalizationProvider dateAdapter={AdapterDayjs}>
            <DemoContainer components={['TimePicker']}>
                <TimePicker
                    label="Movie Start Time"
                    defaultValue={dayjs('2022-04-17T00:00')}
                    onChange={''}
                />
            </DemoContainer>
            </LocalizationProvider>
        </div>

        <div classname="registerformat" style={{ padding: "10px", color: 'black'}}>
            Theater # :
            <select>
            <option value={1}>01</option>
            <option value={2}>02</option>
            <option value={3}>03</option>
            <option value={4}>04</option>
            <option value={5}>05</option>
            <option value={6}>06</option>
            <option value={7}>07</option>
            <option value={8}>08</option>
            <option value={9}>09</option>
            <option value={10}>10</option>
            <option value={11}>11</option>
            <option value={12}>12</option>
        </select>
        </div>
        <h3 style={{ padding: "10px", color: 'black'}}>Select Movie to Show :</h3>
        <div classname="registerformat">
            
            <select
                disabled={false}
                value={select}
                onChange={(e) => setSelected(e.currentTarget.value)}
            >
            {optionList.map((e) => (
            <option key={e.m_id}>
                {e.m_title}
            </option>
            ))}
            </select>
        </div>
            
        <button type="submit" className="submit-btn" onClick={handleSubmit}>
          Submit
        </button>
    </form>


    </body>
)
}
